function MWS = setup_HPT(MWS)%ScalarsMWS.HPT.s_Nc  = 3.708724;MWS.HPT.s_Wc  = 0.1951;MWS.HPT.s_PR  = 0.773898;MWS.HPT.s_Eff = 0.998392;%Design Point DataMWS.HPT.NcMapDes = 100;MWS.HPT.EffDes = 0.9313;MWS.HPT.PRMapDes = 5.0;MWS.HPT.NDes = 20871.0;% Cooling FlowsMWS.HPT.CWPos = [1 0];%Map DataalphaMapDes = 1.0;MWS.HPT.NcVec = [ 60 70 80 90 100 110];MWS.HPT.PRVec(1,:) =   [ 3.000    3.250    3.500    3.750    4.000    4.250    4.500...    4.750    5.000    5.250    5.500    5.750    6.000    6.250...    6.500    6.750    7.000    7.250    7.500    8.000 ];MWS.HPT.effArray(1,:) = [ 0.8460   0.8405   0.8349   0.8296   0.8249   0.8206   0.8165...    0.8127   0.8092   0.8060   0.8030   0.8002   0.7976   0.7953...    0.7931   0.7911   0.7892   0.7875   0.7858   0.7826 ];MWS.HPT.effArray(2,:) = [ 0.8879   0.8842   0.8804   0.8769   0.8735   0.8701   0.8670...    0.8640   0.8614   0.8590   0.8568   0.8548   0.8529   0.8511...    0.8495   0.8479   0.8460   0.8436   0.8414   0.8373 ];MWS.HPT.effArray(3,:) = [ 0.9125   0.9111   0.9096   0.9078   0.9055   0.9034   0.9014...    0.8995   0.8979   0.8964   0.8950   0.8936   0.8924   0.8903...    0.8877   0.8853   0.8830   0.8808   0.8787   0.8749 ];MWS.HPT.effArray(4,:) = [ 0.9228   0.9242   0.9250   0.9247   0.9240   0.9232   0.9224...    0.9217   0.9210   0.9203   0.9197   0.9188   0.9162   0.9137...    0.9113   0.9091   0.9070   0.9050   0.9031   0.8980 ];MWS.HPT.effArray(5,:) = [ 0.9215   0.9258   0.9289   0.9304   0.9313   0.9319   0.9323...    0.9326   0.9328   0.9329   0.9330   0.9311   0.9288   0.9266...    0.9245   0.9225   0.9206   0.9188   0.9161   0.9107 ];MWS.HPT.effArray(6,:) = [ 0.9106   0.9176   0.9232   0.9267   0.9292   0.9312   0.9327...    0.9340   0.9351   0.9361   0.9369   0.9349   0.9329   0.9311...    0.9293   0.9276   0.9259   0.9239   0.9212   0.9161 ];MWS.HPT.WcArray(1,:) = [  30.446   30.533   30.568   30.572   30.572   30.572   30.572...    30.572   30.572   30.572   30.572   30.572   30.572   30.572...    30.572   30.572   30.572   30.572   30.572   30.572 ];MWS.HPT.WcArray(2,:) = [  30.299   30.413   30.480   30.516   30.529   30.530   30.530...    30.530   30.530   30.530   30.530   30.530   30.530   30.530...    30.530   30.530   30.530   30.530   30.530   30.530 ];MWS.HPT.WcArray(3,:) = [  30.120   30.239   30.317   30.368   30.398   30.415   30.421...    30.421   30.421   30.421   30.421   30.421   30.421   30.421...    30.421   30.421   30.421   30.421   30.421   30.421 ];MWS.HPT.WcArray(4,:) = [  30.014   30.124   30.201   30.253   30.288   30.311   30.325...    30.333   30.337   30.337   30.337   30.337   30.337   30.337...    30.337   30.337   30.337   30.337   30.337   30.337 ];MWS.HPT.WcArray(5,:) = [  29.856   29.948   30.013   30.059   30.091   30.113   30.128...    30.139   30.145   30.149   30.150   30.150   30.150   30.150...    30.150   30.150   30.150   30.150   30.150   30.150 ];MWS.HPT.WcArray(6,:) = [  29.799   29.870   29.920   29.955   29.979   29.997   30.009...    30.017   30.023   30.026   30.028   30.029   30.029   30.029...    30.029   30.029   30.029   30.029   30.029   30.029 ];% % Extrapolated map values. Note, these map values are for convergence% % purposes and were defined by extrapolatoin off the generic map above.NcE = [120 130];MWS.HPT.NcVec    = [MWS.HPT.NcVec NcE];MWS.HPT.effArray(7,:) = [  0.8997 0.9094 0.9175 0.9230 0.9271    0.9305    0.9331...    0.9354    0.9374    0.9393    0.9408 0.9387    0.9370    0.9356...    0.9341    0.9327    0.9312    0.9290    0.9263    0.9215];MWS.HPT.effArray(8,:) = [  0.8888    0.9012    0.9118    0.9193    0.9250    0.9298...    0.9335    0.9368    0.9397    0.9425    0.9447    0.9425    0.9411    0.9401...    0.9389    0.9378    0.9365    0.9341    0.9314    0.9269];MWS.HPT.WcArray(7,:) = [  29.7420   29.7920   29.8270   29.8510   29.8670   29.8810...    29.8900   29.8950   29.9010   29.9030   29.9060    29.9080   29.9080...    29.9080   29.9080   29.9080   29.9080   29.9080   29.9080   29.9080];MWS.HPT.WcArray(8,:) = [  29.6850   29.7140   29.7340   29.7470   29.7550   29.7650...    29.7710   29.7730   29.7790   29.7800   29.7840    29.7870   29.7870...    29.7870   29.7870   29.7870   29.7870   29.7870   29.7870   29.7870];% extrapolate Nc for SS analysisNcMin = 50;NcMax = 135;for i = 1:length(MWS.HPT.PRVec)    WcArray_NcMin(i) = interp1(MWS.HPT.NcVec,MWS.HPT.WcArray(:,i)',NcMin,'linear','extrap');    effArray_NcMin(i) = interp1(MWS.HPT.NcVec,MWS.HPT.effArray(:,i)',NcMin,'linear','extrap');    WcArray_NcMax(i) = interp1(MWS.HPT.NcVec,MWS.HPT.WcArray(:,i)',NcMax,'linear','extrap');    effArray_NcMax(i) = interp1(MWS.HPT.NcVec,MWS.HPT.effArray(:,i)',NcMax,'linear','extrap');endMWS.HPT.NcVec = [NcMin MWS.HPT.NcVec NcMax];MWS.HPT.WcArray = [WcArray_NcMin; MWS.HPT.WcArray; WcArray_NcMax];MWS.HPT.effArray = [effArray_NcMin; MWS.HPT.effArray; effArray_NcMax];% extrapolate PR for SS analysisPRMin = 2;PRMax = 10;for i = 1:length(MWS.HPT.NcVec)    WcArray_PRMin(i) = interp1(MWS.HPT.PRVec,MWS.HPT.WcArray(i,:),PRMin,'linear','extrap');    effArray_PRMin(i) = interp1(MWS.HPT.PRVec,MWS.HPT.effArray(i,:),PRMin,'linear','extrap');    WcArray_PRMax(i) = interp1(MWS.HPT.PRVec,MWS.HPT.WcArray(i,:),PRMax,'linear','extrap');    effArray_PRMax(i) = interp1(MWS.HPT.PRVec,MWS.HPT.effArray(i,:),PRMax,'linear','extrap');endMWS.HPT.PRVec = [PRMin MWS.HPT.PRVec PRMax];MWS.HPT.WcArray = [WcArray_PRMin' MWS.HPT.WcArray WcArray_PRMax'];MWS.HPT.effArray = [effArray_PRMin' MWS.HPT.effArray effArray_PRMax'];